import * as React from 'react';

import actionSports from './actionSports';

import { MessageContext } from './context';

export const PeopleProvider = (props: any) => {
  return <MessageContext.Provider value={{ sports: actionSports }}>{props.children}</MessageContext.Provider>;
};
